import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./pages/home"; // Your Home component
import Tassk from "./pages/tassk"; // Your Tasks component
import Shop from "./pages/shop"; // Your Shop component
import Profile from "./pages/profile"; // Your Profile component
import Login from "./auth/login";
import Register from "./auth/register";
import ProtectedRoutes from "./auth/ProtectedRoutes";
import Logout from "./auth/logout";
import Dashboard from './pages/dashboard';
import { AuthProvider } from "./context/AuthContext";


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/logout" element={<Logout />} />
        <Route path="/register" element={<Register />} />
        <Route path="/task" element={<Tassk />} />
        <Route path="/shop" element={<Shop />} />
        <Route path="/profile" element={<Profile />} />
       
       
      </Routes>
    </Router>
  );
}

export default App;
